properties.property:
local Serial = require "actions/Serial"
local Move = require "actions/Move"
local Do = require "actions/Do"
local Parallel = require "actions/Parallel"
local Ease = require "actions/Ease"
local YieldUntil = require "actions/YieldUntil"

return function(self)
    return Serial {
        Do(function() self.sprite.color[4] = 0 end),
        Parallel {
            Ease(self.sprite.color, 4, 30, 2, "inout"),
            Move(self, self.scene.objectLookup.Waypoint3),
            Serial {
                YieldUntil(function() return self.x > 690 end),
                Ease(self.sprite.color, 4, 0, 2, "inout"),
                Do(function() self:remove() end)
            }
        }
    }
end

local Serial = require "actions/Serial"
local Parallel = require "actions/Parallel"
local Move = require "actions/Move"
local Animate = require "actions/Animate"
local Wait = require "actions/Wait"
local Repeat = require "actions/Repeat"
local Do = require "actions/Do"

return function(self)
    return Repeat(Serial {
        Wait(1.5),
        Parallel {
            Serial {
                Move(self, self.scene.objectLookup.ClawWaypoint1),
                Move(self, self.scene.objectLookup.ClawWaypoint2),
                Move(self, self.scene.objectLookup.ClawWaypoint3)
            },
            Do(function()
                local grabbed = self.scene.objectLookup.ClawTemplate1
                grabbed.x = self.x
                grabbed.y = self.y + grabbed.sprite.h*3
            end)
        },
        Animate(self.sprite, "release"),
        Move(self.scene.objectLookup.ClawTemplate1, self.scene.objectLookup.ClawTemplateWaypoint1, "none"),
        Animate(self.sprite, "idle"),
        Parallel {
            Serial {
                Move(self.scene.objectLookup.ClawTemplate1, self.scene.objectLookup.ClawTemplateWaypoint2, "none"),
                Do(function()
                    self.scene.objectLookup.ClawTemplate1.x = 800
                    self.scene.objectLookup.ClawTemplate1.y = 1056
                end)
            },
            Serial {
                Move(self, self.scene.objectLookup.ClawWaypoint3),
                Move(self, self.scene.objectLookup.ClawWaypoint2),
                Move(self, self.scene.objectLookup.ClawWaypoint1),
                Move(self, self.scene.objectLookup.ClawWaypoint0)
            }
        }
    })
end
